I love flowers and am very sentimental about them.  This year I started drying flowers for some of the bouquets that I secretly collected for our couples as well as for important personal events with the notion of turning them into forever works and mementos of art.  Sharing 5 ways to make your flowers forever.  Which one is your favorite? 

To our sweet CEG brides and greater Bay Area couples, reach out if you are interested in us making your wedding flowers forever flowers 🤍

